import React from "react";
import { NavLink } from "react-router-dom";
import '../../src/App.css'

export default function NavBar() {
  return (
      <ul >
        <li><a href="/">Home</a></li>
        <li><a href="/cart">Shopping Cart</a></li>
        <li><a href="/contact">Contact</a></li>
        <li style="float:right"><a href="#about">About</a></li>
      </ul>



  );
}
